const orderModal = document.getElementById("order-modal");
const orderBtn = document.querySelector(".order-btn");
const orderCancelButton = document.querySelector(".order-cancel-btn");
const orderConfirmButton = document.querySelector(".order-confirm-btn");
const madfutUsername = document.getElementById("madfut-username");

orderBtn.addEventListener("click", () => {
    const finalPrice = parseInt(totalPrice.textContent);
    if (finalPrice === 0) {
        alert("Your basket is empty.");
        return;
    }
    if (finalPrice > 50) {
        alert("You cannot order for more than €50 at a time. Please split up your order.");
        return;
    }
    orderModal.style.display = "flex";
    document.body.style.overflowY = "hidden";
});

orderCancelButton.addEventListener("click", () => {
    orderModal.style.display = "none";
    document.body.style.overflowY = null;
});

orderConfirmButton.addEventListener("click", () => {
    if (madfutUsername.value.length <= 0) {
        alert("Please enter a username.");
        return;
    }

    const orderName = orderMap[totalPrice.textContent];
    const orderData = UTF8ToBase64(JSON.stringify({
        username: madfutUsername.value,
        packs: packsBasket,
        cards: cardsBasket,
        coins: parseInt(coinsInput.value.replace(/[^0-9]/g, "").replace(",", "").replace(/^0(?!$)0*/g, ""))
    }));
    
    let orderUrl = `https://shoppy.gg/product/${orderName}?items=${orderData}`;
    window.location.href = orderUrl;
});

